import React, { Component } from 'react';
import { NavbarProvider } from './NavbarContext';
import Navbar from './Navbar';

//Navbar
const navlink = {
    Target1:{
        link:"index.html",
        item:"首頁"
    },
    Target2:{
        link:"activity.html",
        item:"活動"
    },
    Target3:{
        link:"product.html",
        item:"商品"
    }
};

class Header extends Component {
    render(){
        return (
            <>
            <div id="header">
                <NavbarProvider value={navlink}>
                    <Navbar></Navbar>
                </NavbarProvider>
            </div>
            </>
        );
    }
}

export default Header;
